function calculateStoch(source, length) {
    /* Check if we have enough values to make the calculation */
    let calcRtn = 0

    if (source.length < length) { return 0 }

    /* Get highest high and lowest low of n-last elements */
    let high = Math.max(...source)
    let low = Math.min(...source)

    /* Check on division by Zero */
    if (high === low) { return 0 }

    calcRtn = 100 * (source.at(-1) - low) / (high - low)
    return calcRtn
}

/* Calculate Simple Moving Average */
function calculateSMA(values, length) {
    /* Check we have enough values to make the calculation */
    if (values.length < length) { return 0 }

    let sum = 0 // Initialize sum variable. 
    for (let i = values.length - length; i < values.length; i++) { // Iterate through the last periods
        sum = sum + values[i]
    }

    return sum / length
}

